                    { new Guid("17617323-50a0-492c-a220-84ea0235735f"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3188), "Đau ruột thừa là dấu hiệu cảnh báo ruột thừa đang có vấn đề, thường gặp nhất là viêm ruột thừa, ruột thừa có thể bị vỡ, nguy hiểm đến tính mạng.", false, null, null, "Đau ruột thừa", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F17.png?alt=media&token=5abfa254-9207-401f-a0c7-e26a8dd21758" },
                    { new Guid("2ae51909-7baa-4de0-ae83-c13c0498b157"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3177), "Thiếu máu là tình trạng lượng huyết sắc tốc và số lượng hồng cầu có trong máu ngoại vi bị giảm đi, kết quả là thiếu lượng oxy đến các mô của các tế bào trong cơ thể.\r\n", false, null, null, "Thiếu máu", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F13.png?alt=media&token=87ec19fe-4d4c-4a31-b483-4edd092b37ca" },
                    { new Guid("2e2c200b-4115-4f49-8516-2a33654c2c00"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3195), "Huyết áp thấp sẽ nguy hiểm đến tính mạng nếu như không được phòng tránh và chữa trị kịp thời.", false, null, null, "Huyết áp thấp", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F19.png?alt=media&token=6063eac6-6089-4c1e-b8dc-c3462f6f614d" },
                    { new Guid("37437d9f-7753-4ee4-a04d-e1ce1651c54f"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3113), "Đau bụng kinh (hay thống kinh) là triệu chứng rất phổ biến, liên quan đến chu kỳ kinh nguyệt của nữ giới.", false, null, null, "Đau bụng kinh", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F5.png?alt=media&token=fef3d98d-4a75-43e8-a646-90f6ce108eb2" },
                    { new Guid("491f2b78-009d-4d2e-8ad7-02c25e44dd95"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3170), "Người bị đột quỵ cần được cấp cứu ngay lập tức, thời gian kéo dài càng lâu, số lượng tế bào não chết càng nhiều sẽ ảnh hưởng lớn tới khả năng vận động và tư duy của cơ thể, thậm chí là tử vong.", false, null, null, "Đột quỵ", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F12.png?alt=media&token=aac969a3-f28e-4835-ad03-664e1a6bcc3f" },
                    { new Guid("4edc5c6e-daa5-48a5-9f1b-d63ee7eb6fc3"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3202), "Bệnh viêm kết mạc là bệnh thường gặp, do nhiều nguyên nhân khác nhau gây ra. Bệnh có thể tự khỏi mà không cần điều trị. ", false, null, null, "Viêm kết mạc", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F21.png?alt=media&token=9e29f660-da22-4402-a06c-399e2daea67c" },
                    { new Guid("59a9e104-7d3b-43a9-afc1-0c58b3ae4016"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3180), "Rối loạn nhịp tim là tình trạng xảy ra khi các xung điện điều khiển nhịp tim hoạt động bất thường, khiến tim đập quá nhanh, quá chậm hoặc không đều. ", false, null, null, "Rối loạn nhịp tim", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F14.png?alt=media&token=cfc0e696-e3c0-4bb7-8c3e-06278e059fac" },
                    { new Guid("5e3e996b-cf80-46be-93a1-e822fda0d50e"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3153), "Viêm tai giữa là một nhóm các bệnh ở tai giữa, là sự tổn thương và viêm nhiễm xuất hiện trong tai giữa do các loại vi khuẩn sinh sôi và phát triển trong tai hoặc bị tác động từ các yếu tố bên ngoài môi trường.", false, null, null, "Viêm tai giữa", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F7.png?alt=media&token=75541064-4a88-4d7b-bad7-6d0d889d78a1" },
                    { new Guid("689782fb-f292-47fb-9e78-990e92a0e390"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3108), "Táo bón là tình trạng khó đi đại tiện, phân khô cứng, buồn đi đại tiện mà không đi được phải rặn mạnh phân khó thoát ra, thời gian đi lâu hoặc nhiều ngày mới đi một lần.", false, null, null, "Táo bón", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F4.png?alt=media&token=8e16723e-692c-4d85-ad9d-9c2bae33b4f8" },
                    { new Guid("7ba022bb-325a-4058-a4d9-63892767d7ed"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3205), "Gãy xương đòn là gãy xương nằm dài nằm ngay dưới da vùng vai, nối giữa xương ức và hệ thống đai vai – cánh tay, có tác dụng như một thanh chống, giằng giữa thân mình và khớp vai.", false, null, null, "Gãy xương đòn", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F22.png?alt=media&token=5ed305ab-386a-4c35-ac2b-7707d09780f9" },
                    { new Guid("8d4a29c0-775f-49f6-9598-5dbfacccced9"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3103), "Cảm lạnh là một trong những căn bệnh về đường hô hấp thường gặp phải ở trẻ em và người lớn", false, null, null, "Cảm lạnh", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F2.png?alt=media&token=9124ffdd-26cf-4702-b5af-f9b6a22e3d5a" },
