                    { new Guid("e6513d6e-0d42-480c-925f-7bf931f86cd0"), null, new DateTime(2024, 3, 29, 14, 9, 16, 176, DateTimeKind.Local).AddTicks(3198), "Rối loạn thần kinh thực vật là sự mất cân bằng của hai hệ thống thần kinh giao cảm và phó giao cảm. Bệnh gây đau khiến bệnh nhân gặp phải những hạn chế trong cuộc sống. ", false, null, null, "Rối loại thần kinh thực vật", "https://firebasestorage.googleapis.com/v0/b/linhchidoisos.appspot.com/o/ChuanDoan%2F20.png?alt=media&token=f2764426-42d0-48b8-abc4-1a0e0e5a7cb8" },
